from typing import List
from collections import deque

class Solution:
    def nearestExit(self, maze: List[List[str]], entrance: List[int]) -> int:
        answer = -1
        stack = deque([[entrance, 0]])
        while stack:
            curcell, length = stack.popleft()
            print(curcell, length)
            if answer != -1 and length > answer:
                continue

            if (
                curcell[0] == 0
                or curcell[0] == len(maze) - 1
                or curcell[1] == 0
                or curcell[1] == len(maze[0]) - 1
            ) and curcell != entrance:
                return length

            maze[curcell[0]][curcell[1]] = "+"
            u, d, l, r = (
                [curcell[0] - 1, curcell[1]],
                [curcell[0] + 1, curcell[1]],
                [curcell[0], curcell[1] - 1],
                [curcell[0], curcell[1] + 1],
            )

            for point in [u, d, r, l]:
                if 0 <= point[0] <len(maze) and 0 <= point[1] < len(maze[0]) and maze[point[0]][point[1]] == ".":
                    stack.append([point, length+1])
                    maze[point[0]][point[1]] = "+"

        return answer


